		/* Methods
		--------------------------------------------------------------------------------*/
		function playMovie(frame) {
			var frame = (typeof frame !== "undefined") ?  frame : Container.currentFrame;
			
			frame = frame == 0 ? 1 : frame;
			
			// Figure out where sound should start
			checkSoundInstance(frame);
			
			// Play movie and sound together
			Container.gotoAndPlay(frame);
		}	
			
		function stopMovie() {
			// Stop movie and sound
			Container.stop();
			currentSoundInstance.stop();
		}
		
		function frameHasSound() {
			var hasSound = false;
			for (var i = 0; i < soundData.length; i++) {
				if (Container.currentFrame >= soundData[i].low && Container.currentFrame <= soundData[i].high) {
					hasSound = true;
					break;
				}
			}
			return hasSound;
		}
		
		function checkSoundInstance(frame, fromSoundComplete) {
			// Parameter defaults
			var frame = (typeof frame !== "undefined") ?  frame : Container.currentFrame;
			var fromSoundComplete = (typeof fromSoundComplete !== "undefined") ?  fromSoundComplete : false;
			
			var soundID = "";
			var lowBoundary;
			
			if (fromSoundComplete) {
				// Move on to the next sound regarless of positiion (when previous sound completes)
				currentSoundIndex++;
			}
			else {
				// Find sound ID based on frame (play/pause or catch ups)
				for (var i = soundData.length - 1; i >=0; i--) {
					if (frame >= soundData[i].low && frame <= soundData[i].high) {
						currentSoundIndex = i;
						break;
					}
				}
			}
			
			// Record new soundID and low boundary
			soundID = soundData[currentSoundIndex].id;
			lowBoundary = soundData[currentSoundIndex].low;
			
			// Create new sound instance if neccessary
			if (soundID != currentSoundID) {
				// Record new sound ID
				currentSoundID = soundID
				
				// Destroy old sound instance if exists
				if (typeof currentSoundInstance !== "undefined") {
					currentSoundInstance.destroy();
				}
				
				// Create new sound instance
				currentSoundInstance = createjs.Sound.createInstance(currentSoundID);
				currentSoundInstance.on("complete", onSoundComplete);
			}
			
			// Play sound instance where its supposed to be
			var playOffset = fromSoundComplete ? 0														// Start at beginning if from complete
											   : Math.round((frame - lowBoundary) * 1000 / FRAMERATE);  // Start sycned with frame
			
			currentSoundInstance.play({
				interrupt: createjs.Sound.INTERRUPT_ANY,
				offset: playOffset
			});
		}
		
		function syncAudio() {
		
			// Should any sound be playing? If not, don't do anything else
			var hasSound = frameHasSound();
			
			// Make sure audio and audio and movie are synced
			if (hasSound && currentSoundInstance.playState == createjs.Sound.PLAY_SUCCEEDED && !currentSoundInstance.paused) {
				// Calculate how off the sound is from the movie
				var soundFrame = soundData[currentSoundIndex].low + Math.round(FRAMERATE * currentSoundInstance.position / 1000);
				var frameOffset = Math.abs(soundFrame - Container.currentFrame);
				
				// Test frame offset against tolerance
				if (frameOffset >= FRAME_OFFSET_TOLERANCE) {
					// Reset sound position
					var newSoundPosition = 1000 * (Container.currentFrame - soundData[currentSoundIndex].low) / FRAMERATE;
					currentSoundInstance.position = newSoundPosition
				}
			}
		}
		
